Infelizmente, a história de uma criança neozelandesa submetida a uma cirurgia cardíaca, cujos pais lutaram para garantir que apenas sangue de doadores não vacinados fosse usado durante a operação, terminou com uma decisão judicial contra eles - eles agora estão privados de seus direitos parentais

 Basicamente, a Nova Zelândia é um buraco do inferno satânico controlado, onde a sujeira do mal pode levar seu filho à força e médicos doentes podem então transfundir a referida criança com sangue infundido de AIDS contaminado, e não há absolutamente nada que você possa fazer para detê-los.

